script: |
  super -f text -I q5599.spq | sort > q5599.out

inputs:
  - name: q5599.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE ( ( ( - col2 ) ) * - col1 ) NOT BETWEEN NULL AND 18 + + col2 - - + col0 + + 0 * - - 8 * - 37 * + col1;
  - name: tab0

outputs:
  - name: q5599.out
    data: |
      15	81	47
      87	21	10
